window.CUCUMBER_MESSAGES = [{"meta":{"protocolVersion":"24.1.0","implementation":{"name":"cucumber-jvm","version":"7.18.1"},"runtime":{"name":"OpenJDK 64-Bit Server VM","version":"23-valhalla+1-90"},"os":{"name":"Windows 11"},"cpu":{"name":"amd64"}}},{"testRunStarted":{"timestamp":{"seconds":1760874822,"nanos":550925800}}},{"source":{"uri":"classpath:uo\/ri\/cws\/application\/service\/contract\/Add.feature","data":"Feature: [C.A] Add a contract for a mechanic\n  As a Manager\n  I want to hire a mechanic\n\n  Scenario Outline: [C.A.1] Hire an existing mechanic with no previous contract in force\n    Given [C.A.1] a mechanic with no contract\n    When [C.A.1] I hire that mechanic with an annual <salary>\n    Then [C.A.1] a contract in force for that mechanic is created\n      And [C.A.1] start date is first day next month\n    Examples:\n        | salary   |\n        | 12000.0  |\n        | 18000.0  |\n        | 24000.0  |\n        | 30000.0  |\n        | 36000.0  |\n        | 60000.0  |\n        | 90000.0  |\n        | 320000.0 |\n\n  Scenario: [C.A.2] Hire an existing mechanic with a previous contract in force shorter than a year\n    Given [C.A.2] an already less-than-a-year hired mechanic\n    When [C.A.2] I create a new contract for that mechanic\n    Then [C.A.2] there is a new contract in force for that mechanic\n      And [C.A.2] previous contract is terminated with no settlement\n\n  Scenario: [C.A.3] Hire an existing mechanic with previous contract terminated\n    Given [C.A.3] a mechanic with a previous contract terminated\n    When [C.A.3] I hire that mechanic\n    Then [C.A.3] a contract in force for that mechanic is created\n\n  Scenario: [C.A.4] Try to add a contract for a non existing mechanic\n    When [C.A.4] I try to hire a non existent mechanic\n    Then [C.A.4] a business error happens with an explaining message\n\n  Scenario: [C.A.5] Try to add a contract for a non existing contract type\n    When [C.A.5] I try to hire a mechanic with non existent contract type\n    Then [C.A.5] a business error happens with an explaining message\n\n  Scenario: [C.A.6] Try to add a contract for a non existing professional group\n    When [C.A.6] I try to hire a mechanic with non existent professional group\n    Then [C.A.6] a business error happens with an explaining message\n\n  Scenario: [C.A.7] Try to add a contract with end date earlier than start date\n    When [C.A.7] I try to add a contract with end date not later than start date\n    Then [C.A.7] a business error happens with an explaining message\n\n  Scenario: [C.A.8] Try to add a null contract\n    When [C.A.8] I try to add a null argument\n    Then [C.A.8] argument is rejected with an explaining message\n\n  Scenario: [C.A.11] Try to add a contract with null end date when mandatory\n    When [C.A.11] I try to add a contract with null end date for FIXED_TERM contract type\n    Then [C.A.11] argument is rejected with an explaining message\n\n  Scenario Outline: [C.A.12] Try to add a contract with wrong nif\n    When [C.A.12] I try to add a contract with wrong nif <nif>\n    Then [C.A.12] argument is rejected with an explaining message\n    Examples:\n      | nif    |\n      | \"null\" |\n      | \"   \"  |\n      | \"\"     |\n\n  Scenario Outline: [C.A.13] Try to add a contract with wrong values\n    When [C.A.13] I try to add a contract with wrong fields <type> <profGroup> <annualWage>\n    Then [C.A.13] argument is rejected with an explaining message\n    Examples:\n      | type        | profGroup | annualWage |\n      | \"   \"       | \"I\"       | 1000.0     |\n      | \"\"          | \"I\"       | 1000.0     |\n      | \"PERMANENT\" | \" \"       | 1000.0     |\n      | \"PERMANENT\" | \"\"        | 1000.0     |\n      | \"PERMANENT\" | \"I\"       | 0.0        |\n      | \"PERMANENT\" | \"I\"       | -1000.0    |","mediaType":"text\/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"classpath:uo\/ri\/cws\/application\/service\/contract\/Add.feature","f estStepFinished":{"testCaseStartedId":"7d5aaddd-c418-48a2-8469-3cd47231f0ec","testStepId":"7c6d7c2d-97d2-4e19-9371-2c72e7daefd3","testStepResult":{"duration":{"seconds":0,"nanos":0},"status":"PASSED"},"timestamp":{"seconds":1760874824,"nanos":736942700}}},{"testStepStarted":{"testCaseStartedId":"7d5aaddd-c418-48a2-8469-3cd47231f0ec","testStepId":"081eda13-edb3-4022-b457-aff83697922c","timestamp":{"seconds":1760874824,"nanos":736942700}}},{"testStepFinished":{"testCaseStartedId":"7d5aaddd-c418-48a2-8469-3cd47231f0ec","testStepId":"081eda13-edb3-4022-b457-aff83697922c","testStepResult":{"duration":{"seconds":0,"nanos":0},"status":"PASSED"},"timestamp":{"seconds":1760874824,"nanos":736942700}}},{"testCaseFinished":{"testCaseStartedId":"7d5aaddd-c418-48a2-8469-3cd47231f0ec","timestamp":{"seconds":1760874824,"nanos":736942700},"willBeRetried":false}},{"source":{"uri":"classpath:uo\/ri\/cws\/application\/service\/contract\/Finds.feature","data":"Feature: [C.F] Find contracts\n  As a manager I want to find an specific contract by id,\n  all contracts for a mechanic by mechanic dni\n  and also all contracts\n\n  # Find all contracts\n  Scenario: [C.F.1] Find all contracts when there are none\n    When [C.F.1] I search for all contracts\n    Then [C.F.1] List of contracts summary is empty\n\n  Scenario: [C.F.2] Find all contracts when there are some\n    Given [C.F.2] several contracts in the system\n    When [C.F.2] I search for all contracts\n    Then [C.F.2] All contract summaries are found\n\n  # Find contract by id\n  Scenario: [C.F.3] Find by id an existent contract in force\n    Given [C.F.3] an in-force contract\n    When [C.F.3] I search for that contract\n    Then [C.F.3] the contract is found\n\n  Scenario: [C.F.4] Find by id an existent contract terminated\n    Given [C.F.4] an terminated contract\n    When [C.F.4] I search for that contract\n    Then [C.F.4] the contract is found\n\n  Scenario: [C.F.5] Find by id a non existent contract\n    When [C.F.5] I search a non existing contract id\n    Then [C.F.5] nothing is found\n\n  Scenario: [C.F.6] Try to find a contract with null id\n    When [C.F.6] I try to find a contract with null id\n    Then [C.F.6] argument is rejected with an explaining message\n\n  Scenario: [C.F.7] Try to find a contract for a mechanic with null arg\n    When [C.F.7] I try to find a contract for a mechanic with null id\n    Then [C.F.7] argument is rejected with an explaining message\n\n  # Find contracts by mechanic id\n  Scenario: [C.F.8] Find contracts by mechanic id for a non existent mechanic\n    When [C.F.8] I search contracts for a non existent mechanic\n    Then [C.F.8] List of contracts summary is empty\n\n  Scenario: [C.F.9] Find contracts by mechanic id for an existent mechanic with no contracts\n    Given [C.F.9] a mechanic with no contracts\n    When [C.F.9] I search contracts for that mechanic\n    Then [C.F.9] List of contracts summary is empty\n\n  Scenario: [C.F.10] Find contracts by mechanic ID for an existing mechanic with no active contracts and several terminated contracts with no payrolls.\n    Given [C.F.10] a mechanic with several contracts terminated\n    When [C.F.10] I search contracts for that mechanic\n    Then [C.F.10] All contract summaries are found\n\n  Scenario: [C.F.11] Find contracts by mechanic ID for an existing mechanic with one active contract and several payrolls.\n    Given [C.F.11] a mechanic with one in-force contract and several payrolls\n    When [C.F.11] I search contracts for that mechanic\n    Then [C.F.11] All contract summaries are found\n\n  Scenario: [C.F.12] Find contracts by mechanic id for an existent mechanic with several contracts terminated and one contract in force with several payrolls\n    Given [C.F.12] a mechanic with several contracts terminated and one in force all with payrolls\n    When [C.F.12] I search contracts for that mechanic\n    Then [C.F.12] All contract summaries are found","mediaType":"text\/x.cucumber.gherkin+plain"}} n in-force contract longer than a year with its payrolls\n    When [C.T.2] I terminate that contract\n    Then [C.T.2] settlement is properlly calculated\n\n  Scenario: [C.T.3] Try to terminate a terminated contract\n    Given [C.T.3] a terminated contract \n    When [C.T.3] I try to terminate a terminated contract for mechanic <nif>\n    Then [C.T.3] a business error happens with an explaining message\n      \n  Scenario: [C.T.4] Try to terminate a non existent contract\n    When [C.T.4] I try to terminate a non existent contract\n    Then [C.T.4] a business error happens with an explaining message\n\n  Scenario Outline: [C.T.5] Try to terminate a contract with wrong id\n    When [C.T.5] I try to terminate a contract with wrong <id>\n    Then [C.T.5] argument is rejected with an explaining message\n    Examples:\n      | id     | \n      | \"null\" |\n      | \"\"     |\n      | \"  \"   |","mediaType":"text\/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"classpath:uo\/ri\/cws\/application\/service\/contract\/Terminate.feature","feature":{"location":{"line":1,"column":1},"tags":[],"language":"en","keyword":"Feature","name":"[C.T] Terminate a contract","description":"  As a manager \n  If the mechanic changes it lobour state or it is fired we need terminate his\/her contract","children":[{"scenario":{"location":{"line":5,"column":3},"tags":[],"keyword":"Scenario","name":"[C.T.1] Terminate a contract in force shorter than a year","description":"","steps":[{"location":{"line":6,"column":5},"keyword":"Given ","keywordType":"Context","text":"[C.T.1] an in-force contract shorter than a year with its payrolls","id":"8a3538d3-25ef-4ce8-a2c9-7ce83c00c357"},{"location":{"line":7,"column":5},"keyword":"When ","keywordType":"Action","text":"[C.T.1] I terminate that contract","id":"07767173-ae7b-4a5b-af08-af5fa3c5d2ed"},{"location":{"line":8,"column":5},"keyword":"Then ","keywordType":"Outcome","text":"[C.T.1] there is no active contract for the mechanic","id":"62869fd6 age\n\n  Scenario: [C.U.8] Try to update a contract with null id\n    When [C.U.8] I try to update a contract with null id\n    Then [C.U.8] argument is rejected with an explaining message\n\n  Scenario Outline: [C.U.9] Try to update a contract with wrong id\n    When [C.U.9] I try to update a contract with id <ident>\n    Then [C.U.9] argument is rejected with an explaining message\n    Examples: \n      | ident  |\n      | \"null\" |\n      | \"  \"   |\n      | \"\"     |\n\n  Scenario Outline: [C.U.10] Try to update a contract with wrong salary\n    Given [C.U.10] an in-force contract\n    When [C.U.10] I try to update a contract with wrong salary <money>\n    Then [C.U.10] argument is rejected with an explaining message\n    Examples: \n      | money  |\n      |    0.0 |\n      | -100.0 |","mediaType":"text\/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"classpath:uo\/ri\/cws\/application\/service\/contract\/Update.feature","feature":{"location":{"line":1,"column":1},"tags":[],"language":"en","keyword":"Feature","name":"[C.U] Update a contract","description":"  As a manager \n  I want to update some fields of a contract","children":[{"scenario":{"location":{"line":5,"column":3},"tags":[],"keyword":"Scenario","name":"[C.U.1] Update end date","description":"","steps":[{"location":{"line":6,"column":5},"keyword":"Given ","keywordType":"Context","text":"[C.U.1] an in-force fixed-term contract","id":"6e2447b1-d601-4fe5-a864-819b72aa9a72"},{"location":{"line":7,"column":5},"keyword":"When ","keywordType":"Action","text":"[C.U.1] I update the end date of the contract","id":"6b16beee-1f17-42e0-83e8-e134b17c8725"},{"location":{"line":8,"column":5},"keyword":"Then ","keywordType":"Outcome","text":"[C.U.1] the end date is updated","id":"a615cc9b-87dd-4675-a5fe-381ad99bb54a"}],"examples":[],"id":"aea29054-db17-4ced-86b6-f946e8a71db6"}},{"scenario":{"location":{"line":10,"column":3},"tags":[],"keyword":"Scenario","name":"[C.U.2] Update salary","description":"","step I.C.4] a business error happens with an explaining message\n\n  Scenario: [I.C.5] Trying to create one invoice there is one workorder OPEN\n    Given [I.C.5] a client registered with a vehicle and a list of several finished workorder\n    And [I.C.5] one OPEN workorder\n    When [I.C.5] I try to create an invoice\n    Then [I.C.5] a business error happens with an explaining message\n\n  Scenario: [I.C.6] Trying to create one invoice but one workorder is INVOICED\n    Given [I.C.6] a client registered with a vehicle and a list of several finished workorder\n    And [I.C.6] one INVOICED workorder\n    When [I.C.6] I try to create an invoice\n    Then [I.C.6] a business error happens with an explaining message\n\n  Scenario: [I.C.7] Trying to create one invoice for a null argument\n    When [I.C.7] I try to create an invoice for a null list of workorders\n    Then [I.C.7] argument is rejected with an explaining message\n\n  Scenario: [I.C.8] Trying to create one invoice for an empty argument\n    When [I.C.8] I try to create an invoice for an empty list of workorders\n    Then [I.C.8] argument is rejected with an explaining message\n\n  Scenario: [I.C.9] Trying to create one invoice and one of the id is null\n    Given [I.C.9] a client registered with a vehicle and a list of several finished workorder\n    And [I.C.9] a null workorder id\n    When [I.C.9] I try to create an invoice\n    Then [I.C.9] argument is rejected with an explaining message","mediaType":"text\/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"classpath:uo\/ri\/cws\/application\/service\/invoice\/CreateInvoiceFor.feature","feature":{"location":{"line":1,"column":1},"tags":[],"language":"en","keyword":"Feature","name":"[I.C] Create one invoice for one or multiple jobs","description":"  As a Cashier\n  I want to create an invoice for several jobs done for a single client \n  Because I want to get paid","children":[{"scenario":{"location":{"line":6,"column":3},"tags":[],"keyword":"Scenario","nam hanic with interventions registered\n    When [M.D.4] I try to remove the mechanic\n    Then [M.D.4] a business error happens with an explaining message\n\n  Scenario: [M.D.5] Try to delete a mechanic with null argument\n    When [M.D.5] I try to remove a mechanic with null argument\n    Then [M.D.5] argument is rejected with an explaining message\n\n  Scenario: [M.D.6] Try to delete a mechanic with a contract in force\n    Given [M.D.6] a mechanic with a contract in force\n    When [M.D.6] I try to delete the mechanic\n    Then [M.D.6] a business error happens with an explaining message\n\n  Scenario: [M.D.7] Try to delete a mechanic with a terminated contract\n    Given [M.D.7] a mechanic with a terminated contract\n    When [M.D.7] I try to delete the mechanic\n    Then [M.D.y] a business error happens with an explaining message\n","mediaType":"text\/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"classpath:uo\/ri\/cws\/application\/service\/mechanic\/Delete.feature","feature":{"location":{"line":2,"column":1},"tags":[],"language":"en","keyword":"Feature","name":"[M.D] Delete a mechanic","description":"  As a Manager\n  I want to delete a mechanic in case they have not been used\n  Because we need to keep the system clean","children":[{"scenario":{"location":{"line":7,"column":3},"tags":[],"keyword":"Scenario","name":"[M.D.1] Delete an existing unused mechanic","description":"","steps":[{"location":{"line":8,"column":5},"keyword":"Given ","keywordType":"Context","text":"[M.D.1] a registered mechanic","id":"88323eb5-973f-4905-8b72-a577c3b62698"},{"location":{"line":9,"column":5},"keyword":"When ","keywordType":"Action","text":"[M.D.1] I remove the mechanic","id":"f04d3724-d177-4e4e-a567-5bb9b6ee6c22"},{"location":{"line":10,"column":5},"keyword":"Then ","keywordType":"Outcome","text":"[M.D.1] the mechanic no longer exists","id":"ebbf73da-b0e2-42ac-9f3c-6ad4a5e71800"}],"examples":[],"id":"11fbceb6-1e7e-449f-825c-90ce80a48ac1"}},{"scenario":{"location":{"line n    When [M.U.4] I try to update a mechanic with null name\n    Then [M.U.4] argument is rejected with an explaining message\n\n  Scenario: [M.U.5] Try to update a mechanic with null surname\n    Given [M.U.5] a mechanic\n    When [M.U.5] I try to update a mechanic with null surname\n    Then [M.U.5] argument is rejected with an explaining message\n\n  Scenario: [M.U.6] Try to update a mechanic with null nif\n    Given [M.U.6] a mechanic\n    When [M.U.6] I try to update a mechanic with null nif\n    Then [M.U.6] argument is rejected with an explaining message\n\n  Scenario Outline: [M.U.7] Try to update with wrong parameters\n    Given [M.U.7] a mechanic\n    When [M.U.7] I try to update the mechanic to <name>, <surname> and <nif>\n    Then [M.U.7] argument is rejected with an explaining message\n    Examples: \n      | nif            | name        | surname    |\n      | \"existing nif\" | \"Mechanic1\" | \"\"         |\n      | \"existing nif\" | \"Mechanic1\" | \"     \"    |\n      | \"existing nif\" | \"\"          | \"surname1\" |\n      | \"existing nif\" | \"         \" | \"surname1\" |\n","mediaType":"text\/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"classpath:uo\/ri\/cws\/application\/service\/mechanic\/Update.feature","feature":{"location":{"line":1,"column":1},"tags":[],"language":"en","keyword":"Feature","name":"[M.U] Update a mechanic","description":"  As a Manager\n  I want to update a mechanic","children":[{"scenario":{"location":{"line":5,"column":3},"tags":[],"keyword":"Scenario","name":"[M.U.1] Update an existing mechanic","description":"","steps":[{"location":{"line":6,"column":5},"keyword":"Given ","keywordType":"Context","text":"[M.U.1] a mechanic","id":"b02728f6-8d2a-4d85-8c4c-12fa35cc8f2e"},{"location":{"line":7,"column":5},"keyword":"When ","keywordType":"Action","text":"[M.U.1] I update the mechanic","id":"3d646d95-76e1-42c6-b4f9-b0dda9fe08ff"},{"location":{"line":8,"column":5},"keyword":"Then ","keywordType":"Outcome","text":"  a mechanic with several payrolls\n    When [P.Fs.4] I search payrolls by that mechanic\n    Then [P.Fs.4] all the payroll summaries for that mechanic are found\n\n  Scenario: [P.Fs.5] Find payrolls for a mechanic with no payroll\n    Given [P.Fs.5] a mechanic with no payrolls\n    When [P.Fs.5] I search payrolls by that mechanic\n    Then [P.Fs.5] the result is empty\n\n  Scenario: [P.Fs.6] Find payrolls for a non existent mechanic\n    When [P.Fs.6] I try to find payrolls for a non existent mechanic\n    Then [P.Fs.6] a business error happens with an explaining message\n\n  Scenario Outline: [P.Fs.7] Try to find a payroll with invalid mechanic id\n    When [P.Fs.7] I try to find payrolls with an invalid mechanic <id>\n    Then [P.Fs.7] argument is rejected with an explaining message\n    Examples:\n      | id     |\n      | \"null\" |\n      | \"\"     |\n      | \" \"    |\n\n# Find payrolls by professional group\n  Scenario: [P.Fs.8] Find payrolls for a professional group with one payroll\n    Given [P.Fs.8] a payroll from a contract with a professional group\n    When [P.Fs.8] I search payrolls by that professional group\n    Then [P.Fs.8] the right payroll summary for that professional group is found\n\n  Scenario: [P.Fs.9] Find payrolls for a professional group with several payrolls\n  \tGiven [P.Fs.9] some payrolls of some contracts of some professional groups\n    When [P.Fs.9] I search payrolls for one of those professional groups\n    Then [P.Fs.9] all payroll summaries for that professional group are found\n\n  Scenario: [P.Fs.10] Find payrolls for a professional group with no payroll\n    Given [P.Fs.10] a professional group with no payrolls\n    When [P.Fs.10] I search payrolls for that professional group\n    Then [P.Fs.10] the result is empty\n\n  Scenario: [P.Fs.11] Find payrolls for a non existent professional group\n    When [P.Fs.11] I try to find payrolls with a non existent professional group name\n    Then [P.Fs.11] a business error happens wi  monthly   | extra   | prod  | tri   | tax      | nic     |\n\t  | \"31\/01\/2026\"| \"31\/12\/2025\"| \"01\/06\/2025\"| 12600.0  | 0.0      | 900.00    | 900.00  | 0.0   | 0.0   | 432.00   | 52.50   |\n\t  | \"08\/01\/2022\"| \"31\/12\/2021\"| \"01\/06\/2009\"| 14000.0  | 0.0      | 1000.00   | 1000.00 | 0.0   | 120.0 | 508.80   | 58.33   |\n\t  | \"15\/11\/2025\"| \"31\/10\/2025\"| \"01\/06\/2025\"| 15400.0  | 5000.0   | 1100.00   | 0.00    | 250.0 | 0.0   | 324.00   | 64.17   |\n\t  | \"01\/11\/2021\"| \"31\/10\/2021\"| \"01\/06\/2000\"| 40000.0  | 7500.0   | 2857.14   | 0.00    | 375.0 | 210.0 | 1273.59  | 166.67  |\n\t  | \"31\/01\/2026\"| \"31\/12\/2025\"| \"01\/06\/2025\"| 70000.0  | 0.0      | 5000.00   | 5000.00 | 0.0   | 0.0   | 4500.00  | 291.67  |\n\t  | \"10\/01\/2022\"| \"31\/12\/2021\"| \"01\/06\/2010\"| 19600.0  | 0.0      | 1400.00   | 1400.00 | 0.0   | 90.0  | 693.60   | 81.67   |\n\t  | \"30\/09\/2025\"| \"31\/08\/2025\"| \"01\/06\/2025\"| 21000.0  | 6700.0   | 1500.00   | 0.00    | 335.0 | 0.0   | 550.50   | 87.50   |\n\t  | \"01\/09\/2021\"| \"31\/08\/2021\"| \"01\/06\/2012\"| 350000.0 | 8000.0   | 25000.00  | 0.00    | 400.0 | 90.0  | 11980.30 | 1458.33 |\n\t  | \"30\/07\/2025\"| \"30\/06\/2025\"| \"01\/06\/2025\"| 21000.0  | 6700.0   | 1500.00   | 1500.00 | 335.0 | 0.0   | 1000.50  | 87.50   |\n\t  | \"01\/07\/2021\"| \"30\/06\/2021\"| \"01\/06\/1995\"| 22400.0  | 8000.0   | 1600.00   | 1600.00 | 400.0 | 240.0 | 1152.00  | 93.33   |\n\n  Scenario: [P.G.4] Generate payrolls only for mechanics with an active contract.\n    Given [P.G.4] today is \"2025-08-06\"\n    And [P.G.4] the following relation of mechanics with a contract\n\t  | nif   | state      | startDate  | endDate    |\n\t  | NIF1  | TERMINATED | 2021-01-01 | 2021-05-01 | # no longer an employee\n\t  | NIF2  | TERMINATED | 2022-01-01 | 2023-05-31 | # first contract finished\n\t  | NIF2  | TERMINATED | 2023-06-01 | 2023-12-31 | # renewed and finished\n\t  | NIF2  | IN_FORCE   | 2024-01-01 | 2021-12-01 | # renewed and in force\n\t  | NIF3  | IN_FORCE   | 2023-06-01 |            | # in force\n    When [P.G.4] I generate payrolls\n    Then [P.G.4] two payrolls are generated\n    \n   Scenario: [P.G.5] Generate payrolls twice in the month has no effect\n     Given [P.G.5] several already generated payrolls for this month\n     When [P.G.5] I generate payrolls again\n     Then [P.G.5] no new payrolls are generated\n","mediaType":"text\/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"classpath:uo\/ri\/cws\/application\/service\/payroll\/Generate.feature","feature":{"location":{"line":1,"column":1},"tags":[],"language":"en","keyword":"Feature","name":"[P.G] Generate payrolls for mechanics last month","description":"  As a Manager\n  I want to generate payslips for my employees","children":[{"scenario":{"location":{"line":5,"column":3},"tags":[],"keyword":"Scenario","name":"[P.G.1] Generate payrolls but no mechanic","description":"","steps":[{"location":{"line":6,"column":5},"keyword":"When ","keywordType":"Action","text":"[P.G.1] I generate payrolls","id":"75100170-c540-4e20-9214-b5a8d059e764"},{"location":{"line":7,"column":5},"keyword":"Then ","keywordType":"Outcome","text":"[P.G.1] zero payrolls are generated","id":"13d2d3ea-71e3-4de4-b513-a44286e3d1eb"}],"examples":[],"id":"6a47bba2-7907-491d-822d-4a83ab96817f"}},{"scenario":{"location":{"line":9,"column":3},"tags":[],"keyword":"Scenario","name":"[P.G.2] Generate payrolls for a mechanic with no active contract last month","description":"","steps":[{"location":{"line":10,"column":5},"keyword":"Given ","keywordType":"Context","text":"[P.G.2] a mechanic with several contracts but none active","id":"a359cb47-0752-46eb-9533-7f8eafb9b0c5"},{"location":{"line":11,"column":5},"keyword":"When ","keywordType":"Action","text":"[P.G.2] I generate payrolls","id":"b9f37aa0-6794-4cfa-b45c-78097dea6bea"},{"location":{"line":12,"column":5},"keyword":"Then ","keywordType":"Outcome","text":"[P.G.2] zero payrol
